// get row for anxiety rating
const trial = this.options.datastore.data.filter(row => row.sender === 'Question');

const anxiety_rating= trial.length && trial[0].anxiety_rating

this.data.aggregated = {
  anxiety_rating
}

document.getElementById('rating').onclick = function(e) {
  e.target.classList.add('visible');
  document.getElementById('continueBtn').style.visibility = 'visible';
};
document.getElementById('rating').ontouch = function(e) {
  e.target.classList.add('visible');
  document.getElementById('continueBtn').style.visibility = 'visible';
};
document.getElementById('rating').oninput = function(e) {
  e.target.classList.add('visible');
  document.getElementById('continueBtn').style.visibility = 'visible';
};
